import React from 'react';

const App = () => {
	const now = new Date();
	const a = 10;
	const b = 20;
	return (
		<div className="App">
			<h1>Hello World, its {now.toString()}</h1>
			<p>
				{a} + {b} = {a + b}
			</p>
		</div>
	);
};

export default App;
